import Command from "./Command"

class RemoveDocument extends Command{
    constructor(...args) {
        super(args);
    }
    execute() {
        super.getMiddleware().removeDocument(super.getElement());
    }
    unexecute() {
        super.getMiddleware().addDocument(super.getElement());
    }
}
export default RemoveDocument;
